import React from 'react';
import PoultryLogo from '../Asset/PoultryLogo.jpg'
import './Navbar.css';

function Navbar(){
    return(
        <div className="navbar">
            <div className="navbar_logo">
              <img src={PoultryLogo} alt="" />
                <p className="logo_name">Commerce</p>

            </div>
            <div className="navbar_menu">
                <i className="catagory_menu">Meat</i>
                <i className="catagory_menu">Eggs</i>
                <i className="catagory_menu">Equipment</i>
                <i className="catagory_menu">products</i>
            </div>
        </div>
    );
}
export default Navbar;
